import React, {Component} from "react";

class Micomponente extends Component{

    render(){
        let receta ={
            nombre: 'Pizza',
            ingredientes: ['Tomate','Queso','Jamon cocido'],
            calorias: '400'
        };

        return(
            <div className="mi-componente">
            <h1>{receta.nombre}</h1>
            <h2>{'Calorias' +receta.calorias}</h2>
            <hr/>
            </div>
        
        );
    }

}


export default Micomponente;
